import axios from "axios"
import React from "react"

const Main = () => {
  function fetchData(name, numberPhone) {
    axios
      .post("localhost:5000/api/call", {
        name: name,
        numberPhone: numberPhone,
      })
      .then((res) => {
        console.log(res.data)
      })
      .catch((err) => {
        console.error(err)
      })
  }

  return (
    <main className="main">
      <form>
        <input></input>
        <button type="submit" onClick={() => {axios
      .post("localhost:5000/api/call", {
        name: name,
        numberPhone: numberPhone,
      })
      .then((res) => {
        console.log(res.data)
      })
      .catch((err) => {
        console.error(err)
      })}}>
          Отправить
        </button>
      </form>
    </main>
  )
}

export default Main
